import React, {Component} from 'react';
// import {Link} from 'react-router-dom';
import Cell from "./Cell";

class Day extends Component {

    constructor(props) {
        super();
        this.state = {
            data: null,
            isLoading: false,
            error: null,
        };
        this.val = props.val;
        console.log(this.val);
    };

    render() {
        return (
            <div style={{height:"720px"}}>
                {[...Array(48)].map(i =>{return <Cell parent={this} val={i}></Cell>})}
            </div>
        );
    }
}

export default Day;
